module.exports = { "id": 0, "type": "component", "name": "div", "children": [{ "id": 2, "type": "component", "name": "TextContainer", "children": [{ "id": 3, "type": "meta", "properties": { "title": { "type": "value", "value": "My Idyll Post" }, "description": { "type": "value", "value": "Short description of your project" } } }] }, { "id": 4, "type": "component", "name": "Header", "properties": { "title": { "type": "value", "value": "Visualizing The Affects of Climate Change" }, "subtitle": { "type": "value", "value": "Case Studies in Afirica" }, "author": { "type": "value", "value": "Dykee Gorrell, Advisor: Dr. Jill Naiman" }, "authorLink": { "type": "value", "value": "https://idyll-lang.org" }, "date": { "type": "expression", "value": "(new Date()).toDateString()" }, "background": { "type": "value", "value": "#222222" }, "color": { "type": "value", "value": "#ffffff" } }, "children": [] }, { "id": 5, "type": "component", "name": "TextContainer", "children": [{ "id": 6, "type": "component", "name": "h2", "children": [{ "id": 7, "type": "textnode", "value": "Introduction" }] }, { "id": 8, "type": "component", "name": "p", "children": [{ "id": 9, "type": "textnode", "value": "The study of climate change has been widely explored in the past few decades due it’s growing affect on our planet. From the rise of sea levels, carbon admission, and rising global temperatures, the change in our climate has had astounding effects on all terrestrial ecosystems. Changes in our atmosphere as early as the middle 1700’s has affected agricultural production globally across time and will continue to affect agricultural production for years to come. That being said our project " }, { "id": 10, "type": "component", "name": "em", "children": [{ "id": 11, "type": "textnode", "value": "Visualizing The Effects of Climate Change: Cases Studies in Africa" }] }, { "id": 12, "type": "textnode", "value": " is designed to map these changes in global temperature, precipitation, and crop yields as far back as possible. This project extends the work of scholars Andrew Challinor, Tim Wheeler, Chris Garforth, Peter Craufurd, and Amir Kassam which you can find " }, { "id": 13, "type": "component", "name": "a", "properties": { "href": { "type": "value", "value": "https://link.springer.com/content/pdf/10.1007/s10584-007-9249-0.pdf" } }, "children": [{ "id": 14, "type": "textnode", "value": "here" }] }, { "id": 15, "type": "textnode", "value": ". Although this particular article will talk about specific crop yields across the African continent, our methods in data visualization and machine learning is prepared to tackle other regions of the world across time. " }] }, { "id": 16, "type": "component", "name": "h2", "children": [{ "id": 17, "type": "textnode", "value": "Methods" }] }, { "id": 18, "type": "component", "name": "strong", "children": [{ "id": 19, "type": "textnode", "value": "Linear Regression & Multiple Linear Regression" }] }, { "id": 20, "type": "component", "name": "p", "children": [{ "id": 21, "type": "textnode", "value": "There are a few key components to understand Linear Regression(LR) vs Multiple Linear Regression(MLR). We will first talk about what exactly a “regression” is and its purpose. Then we will discuss the importance of Multiple Linear Regression for certain research questions. " }] }, { "id": 22, "type": "component", "name": "em", "children": [{ "id": 23, "type": "textnode", "value": "What is Regression?" }] }, { "id": 24, "type": "component", "name": "p", "children": [{ "id": 25, "type": "textnode", "value": "Linear regression is a type of supervised learning algorithm. In order to understand this performance, you have to choose a performance measure or make up your own, a fitness function and/or cost function (Aurélien Géron 2017). For the sake of this project, we are using a cost function. A " }, { "id": 26, "type": "component", "name": "a", "properties": { "href": { "type": "value", "value": "https://towardsdatascience.com/machine-learning-fundamentals-via-linear-regression-41a5d11f5220" } }, "children": [{ "id": 27, "type": "textnode", "value": "cost function" }] }, { "id": 28, "type": "textnode", "value": " determines how bad your model is, which is determined by the average “loss” over the entire training dataset. We used a cost function measure to observe the difference in the performance of our model as we added new parameters, which we added more parameters as different slopes in MLR and added rainfall data. " }, { "id": 29, "type": "component", "name": "a", "properties": { "href": { "type": "value", "value": "https://blog.playment.io/what-is-training-data/" } }, "children": [{ "id": 30, "type": "textnode", "value": "Training data" }] }, { "id": 31, "type": "textnode", "value": " is data used in the training process, the training process is when we calculate our best LR or MLR model using the least-squares regression cost function. " }] }, { "id": 32, "type": "component", "name": "p", "children": [{ "id": 33, "type": "textnode", "value": "One of the purposes of a " }, { "id": 34, "type": "component", "name": "a", "properties": { "href": { "type": "value", "value": "https://towardsdatascience.com/modeling-teaching-a-machine-learning-algorithm-to-deliver-business-value-ad0205ca4c86" } }, "children": [{ "id": 35, "type": "textnode", "value": "machine learning model" }] }, { "id": 36, "type": "textnode", "value": " is to find patterns in data to make accurate predictions. This model is data-driven and mathematically informed. We will get into what some of those informative mathematical equations/measures are a little later. That being said, you can determine the accuracy of the model by calculating the difference between the training data and the regression line. The goal of the least-squares regression that we employ to decrease the sum of the distances between the predicted and observed response variables. Furthermore, there are two variables that are significant in describing a regression line. The two variables are called a " }, { "id": 37, "type": "component", "name": "a", "properties": { "href": { "type": "value", "value": "https://newonlinecourses.science.psu.edu/stat200/lesson/1/1.1/1.1.2" } }, "children": [{ "id": 38, "type": "textnode", "value": "response variable and an explanatory variable" }] }, { "id": 39, "type": "textnode", "value": ". Your response variable is typically represented by y and your explanatory variable is represented by X. X for an MLR can also be a multi-dimensional array, compared to your y, which is always one dimensional. A " }, { "id": 40, "type": "component", "name": "a", "properties": { "href": { "type": "value", "value": "http://www.stat.yale.edu/Courses/1997-98/101/linreg.htm" } }, "children": [{ "id": 41, "type": "textnode", "value": "regression line" }] }, { "id": 42, "type": "textnode", "value": " basically describes the changes in your response variable when your explanatory variable changes Let’s look at an example of this using one of our visualizations." }] }, { "id": 43, "type": "component", "name": "p", "children": [{ "id": 44, "type": "textnode", "value": "Cassava: LR(left) vs MLR(right)" }] }, { "id": 45, "type": "component", "name": "Float", "properties": { "position": { "type": "value", "value": "right" } }, "children": [{ "id": 46, "type": "component", "name": "img", "properties": { "src": { "type": "value", "value": "static/images/image2.png" }, "style": { "type": "expression", "value": "{width: 600}" } }, "children": [] }] }, { "id": 47, "type": "component", "name": "Float", "properties": { "position": { "type": "value", "value": "right" } }, "children": [{ "id": 48, "type": "component", "name": "img", "properties": { "src": { "type": "value", "value": "static/images/image3.png" }, "style": { "type": "expression", "value": "{width: 1000}" } }, "children": [] }] }, { "id": 49, "type": "component", "name": "p", "children": [{ "id": 50, "type": "textnode", "value": "If you look at the above visualization for the crop cassava, on the left you have a linear regression model using only temperature as an explanatory variable, while on the right we show a multiple linear regression model which includes both temperature and precipitation as explanatory variables. The only difference between the left and right is the training data which adds precipitation data to our MLR. The linear regression has been created by training our algorithm using crop yields in a specified country for a specific year in global temperature and precipitation data. As you can see the model’s predictions are different between our LR and MLR model due to the inclusion of precipitation data. " }] }, { "id": 51, "type": "component", "name": "strong", "children": [{ "id": 52, "type": "textnode", "value": "Difference between MSE, MAE, and RMSE" }] }, { "id": 53, "type": "component", "name": "p", "children": [{ "id": 54, "type": "textnode", "value": "In regression models, several measures of “goodness of fit” are often discussed. Here we mention the three most common - mean square error (MSE), mean absolute error (MAE) and root mean square error (RMSE) (Aurélien Géron 2017). Our results are showed to the right while below are the differences between all three measures." }, { "id": 55, "type": "component", "name": "Float", "properties": { "position": { "type": "value", "value": "right" } }, "children": [{ "id": 56, "type": "component", "name": "img", "properties": { "src": { "type": "value", "value": "static/images/image11.png" }, "style": { "type": "expression", "value": "{width:600}" } }, "children": [] }] }] }, { "id": 57, "type": "component", "name": "p", "children": [{ "id": 58, "type": "textnode", "value": "Mean Squared Error (MSE):  Measures the average of error squares i.e. the average squared difference between the estimated values and true value.(Aurélien Géron 2017) " }] }, { "id": 59, "type": "component", "name": "Float", "properties": { "position": { "type": "value", "value": "right" } }, "children": [{ "id": 60, "type": "component", "name": "img", "properties": { "src": { "type": "value", "value": "static/images/MSE.png" }, "style": { "type": "expression", "value": "{width:600}" } }, "children": [] }] }, { "id": 61, "type": "component", "name": "p", "children": [{ "id": 62, "type": "textnode", "value": "Mean Absolute Error (MAE): The average of the difference between predicted and actual values in the test, i.e. the average prediction error. (Aurélien Géron 2017)" }] }, { "id": 63, "type": "component", "name": "Float", "properties": { "position": { "type": "value", "value": "right" } }, "children": [{ "id": 64, "type": "component", "name": "img", "properties": { "src": { "type": "value", "value": "static/images/MAE.png" }, "style": { "type": "expression", "value": "{width:600}" } }, "children": [] }] }, { "id": 65, "type": "component", "name": "p", "children": [{ "id": 66, "type": "textnode", "value": "Root Mean Squared Error (RMSE): is the standard deviation of the residuals (prediction errors). Residuals are a measure of how far from the regression line data points are; RMSE is a measure of how to spread out these residuals are. (Aurélien Géron 2017)" }] }, { "id": 67, "type": "component", "name": "Float", "properties": { "position": { "type": "value", "value": "right" } }, "children": [{ "id": 68, "type": "component", "name": "img", "properties": { "src": { "type": "value", "value": "static/images/RMSE.png" }, "style": { "type": "expression", "value": "{width:600}" } }, "children": [] }] }, { "id": 69, "type": "component", "name": "strong", "children": [{ "id": 70, "type": "textnode", "value": "Cost Function" }] }, { "id": 71, "type": "component", "name": "p", "children": [{ "id": 72, "type": "textnode", "value": "Often times the " }, { "id": 73, "type": "component", "name": "a", "properties": { "href": { "type": "value", "value": "https://algorithmia.com/blog/introduction-to-loss-functions" } }, "children": [{ "id": 74, "type": "textnode", "value": "loss function" }] }, { "id": 75, "type": "textnode", "value": " and cost function are used interchangeably although they technically calculate different things. Earlier we stated that the cost function is used to calculate the average loss over the entire dataset. Often the loss function is defined to calculate a single loss in a training data point. That being said, there are " }, { "id": 76, "type": "component", "name": "a", "properties": { "href": { "type": "value", "value": "https://towardsdatascience.com/common-loss-functions-in-machine-learning-46af0ffc4d23" } }, "children": [{ "id": 77, "type": "textnode", "value": "different loss functions" }] }, { "id": 78, "type": "textnode", "value": ". A loss function is a method to evaluate how your algorithm models your dataset. It’s able to do this by measuring the (distance/difference) between our observed y and our predicted y. The resulting value of that difference is referred to as a " }, { "id": 79, "type": "component", "name": "a", "properties": { "href": { "type": "value", "value": "https://www.khanacademy.org/math/statistics-probability/describing-relationships-quantitative-data/regression-library/a/introduction-to-residuals" } }, "children": [{ "id": 80, "type": "textnode", "value": "residual" }] }, { "id": 81, "type": "textnode", "value": ". If the output of the loss function is high that means your predictive value is off. On the other hand, if your output is low that means that your predictive value is good. " }] }, { "id": 82, "type": "component", "name": "strong", "children": [{ "id": 83, "type": "textnode", "value": "Precipitation Data" }] }, { "id": 84, "type": "component", "name": "Plot_cassava", "children": [] }, { "id": 85, "type": "component", "name": "p", "children": [{ "id": 86, "type": "textnode", "value": "The dataset that we used for precipitation was gathered by the " }, { "id": 87, "type": "component", "name": "a", "properties": { "href": { "type": "value", "value": "https://climatedataguide.ucar.edu/climate-data/gpcc-global-precipitation-climatology-centre" } }, "children": [{ "id": 88, "type": "textnode", "value": "Global Precipitation Climogotoly Center" }] }, { "id": 89, "type": "textnode", "value": " which collects the monthly land-surface precipitation using rain gauges built on GTS data as well as historical data. The precipitation data that was gathered varies depending on time, calculated by months, longitude and latitude, which is particular to each country, and rainfall over a given month. Much of the cleaning, analyzing, and aggregation process had to do with calculating monthly measurements and organizing those monthly measurements into yearly measurements based on country. Our goal for our precipitation is to decrease the number of missing values for each country by increasing the resolution of the data. Currently, we are using a 2.5 resolution, we plan on using a 0.5 resolution for better accuracy. " }] }, { "id": 90, "type": "component", "name": "h2", "children": [{ "id": 91, "type": "textnode", "value": "Discussion" }] }, { "id": 92, "type": "component", "name": "strong", "children": [{ "id": 93, "type": "textnode", "value": "The Future of our Model" }] }, { "id": 94, "type": "component", "name": "p", "children": [{ "id": 95, "type": "textnode", "value": "Although we’ve created a model our model fails to take into account all potential variables that could affect the change in climate in Africa. There seems to be some association between crop yields, temperature, and precipitation rates in a given country however we don’t have anything about causality. Also, we are using a simple two-parameter mlr model which can be more effective by adding more parameters. Therefore our model is not perfect and definitely needs some work. Here is a list of 5 “next steps” we plan on taking to address the shortcomings of our model in future research, accompanied by a brief explanation. " }] }, { "id": 96, "type": "component", "name": "p", "children": [{ "id": 97, "type": "component", "name": "em", "children": [{ "id": 98, "type": "textnode", "value": "We plan on updating our temperature dataset with a more technical resource." }] }, { "id": 99, "type": "textnode", "value": "\n" }] }, { "id": 100, "type": "component", "name": "ul", "children": [{ "id": 101, "type": "component", "name": "li", "children": [{ "id": 102, "type": "textnode", "value": "Currently, we are using a temperature dataset from Kaggle, which is not ideal for our future work. We believe that by incorporating a dataset from a more technical resource we increase the accuracy of our temperature variable." }] }] }, { "id": 103, "type": "component", "name": "em", "children": [{ "id": 104, "type": "textnode", "value": "We plan on recalculating our precipitation data using a finer grid." }] }, { "id": 105, "type": "component", "name": "p", "children": [{ "id": 106, "type": "component", "name": "em", "children": [{ "id": 107, "type": "textnode", "value": "We plan on fitting a polynomial regression to understand how rainfall changes over the year" }] }, { "id": 108, "type": "textnode", "value": "\n" }] }, { "id": 109, "type": "component", "name": "ul", "children": [{ "id": 110, "type": "component", "name": "li", "children": [{ "id": 111, "type": "textnode", "value": "This may give us insight into how extreme weather events such as droughts and floods affect crop production during particular parts of the year." }] }] }, { "id": 112, "type": "component", "name": "p", "children": [{ "id": 113, "type": "component", "name": "em", "children": [{ "id": 114, "type": "textnode", "value": "We plan on using more regional designations instead of countries." }] }, { "id": 115, "type": "textnode", "value": "\n" }] }, { "id": 116, "type": "component", "name": "ul", "children": [{ "id": 117, "type": "component", "name": "li", "children": [{ "id": 118, "type": "textnode", "value": "Do to both the size of the African continent as well as it’s colonial history, we plan on using more regional geographic designations in order to explore the changes in crop production based on a series of social and environmental variables. We believe it is important to understand how socio-political issues impact crop production." }] }] }, { "id": 119, "type": "component", "name": "p", "children": [{ "id": 120, "type": "component", "name": "em", "children": [{ "id": 121, "type": "textnode", "value": "Our knowledge of the science of African Climate Change is limited." }] }, { "id": 122, "type": "textnode", "value": " Therefore we plan on doing more research into how other scholars in the field have gone about developing models to describe how Africa has been affected by climate change. " }] }, { "id": 123, "type": "component", "name": "strong", "children": [{ "id": 124, "type": "textnode", "value": "Other Important To-Do Items" }] }, { "id": 125, "type": "component", "name": "ul", "children": [{ "id": 126, "type": "component", "name": "li", "children": [{ "id": 127, "type": "textnode", "value": "Figure out Interactive Plot for Globes and Crops." }] }] }, { "id": 128, "type": "component", "name": "ul", "children": [{ "id": 129, "type": "component", "name": "li", "children": [{ "id": 130, "type": "textnode", "value": "Figure out how to output the data into a JSON file." }] }] }, { "id": 131, "type": "component", "name": "ul", "children": [{ "id": 132, "type": "component", "name": "li", "children": [{ "id": 133, "type": "textnode", "value": "Making the globes into a drop-down to select for different crops." }] }] }, { "id": 134, "type": "component", "name": "ul", "children": [{ "id": 135, "type": "component", "name": "li", "children": [{ "id": 136, "type": "textnode", "value": "Make the regression plots interactive." }] }] }, { "id": 137, "type": "component", "name": "ul", "children": [{ "id": 138, "type": "component", "name": "li", "children": [{ "id": 139, "type": "textnode", "value": "Create a Visual Design for Web Page." }] }] }] }] };

